import React, { Component } from 'react';
import { Link } from 'react-router-dom';

class Layout extends Component {
  state ={
    showNav:false
  }

  toggleSidenav = (action) => {
    this.setState({
      showNav:action
    })
  }

render(){
  return(
    <div>
      <Link to = {'/about'} className = 'btn'> About </Link>
      {this.props.children}
    </div>
  )
}

}

export default Layout;
